import React from "react";
import Logo from '../assets/header/Logotype.png';
import Man from '../assets/header/Man.png';
import Logos from '../assets/header/Logos.png';
import Icon from '../assets/header/Icon.png';
import styles from './header.css';
import { useTheme } from '../ThemeSwitch/ThemeContext';
import ThemeSwitcher from '../ThemeSwitch/ThemeSwitcher';
import themeStyles from '../ThemeSwitch/theme.css';
import classNames from 'classnames';

const AppHeader = () => {
    const { isDarkTheme } = useTheme();

    return (
        <div className={classNames(styles.header, { [themeStyles.darkTheme]: isDarkTheme, [themeStyles.lightTheme]: !isDarkTheme })}>
            <div className={styles.navbar}>
                <a href="#"><img src={Logo} alt="Logo" /></a>
                <div className={styles.menu}>
                    <a href="#">About us</a>
                    <a href="#">Team</a>
                    <a href="#">Solutions</a>
                    <a href="#">Blog</a>
                </div>
                <button className={styles.btnHeader}>Get in touch  <b>â†’</b></button>
                <ThemeSwitcher />
            </div>
            <div className={styles.line}></div>
        </div>
    );
};

export default AppHeader;
